import DiaryItem from "./DiaryItem.js";

const DiaryList = ({diaryList}) => {
  console.log(diaryList);
  return (
    <div ClassName="DiaryList">
      <h2>List</h2>
      <h4>{diaryList.length}개의 일기가 있습니다.</h4>
      <div>
        {diaryList.map((it) => (
          <div key={it.id}>
            <DiaryItem/>
          </div>
        ))}
      </div>
    </div>
  );
};

//데이터가 undefined인 경우 에러나지 않도록 함.
